### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Database Management Systems (DBMS)
- **SQL Queries**: Understanding and writing SQL queries to manipulate and retrieve data from databases.
  - **SELECT**: Retrieving data from a database.
  - **WHERE**: Filtering data based on conditions.
  - **GROUP BY**: Grouping data based on one or more columns.
  - **ORDER BY**: Sorting the result set.
  - **JOIN**: Combining rows from two or more tables based on a related column.
  - **LIKE**: Pattern matching in SQL.
  - **EXISTS**: Checking for the existence of rows in a subquery.
  - **ALL**: Comparing a value to all values in another set.

- **Relational Algebra**: Understanding the fundamental operations of relational algebra.
  - **Selection (σ)**: Selecting rows that satisfy a given predicate.
  - **Projection (Π)**: Selecting columns from a relation.
  - **Join (⋈)**: Combining relations based on a common attribute.
  - **Cartesian Product (×)**: Combining every row of one relation with every row of another relation.

- **Entity-Relationship (E-R) Diagrams**: Understanding and interpreting E-R diagrams to model the database schema.
  - **Entities**: Objects or things in the real world that are distinguishable from other objects.
  - **Attributes**: Properties or details of an entity.
  - **Relationships**: Associations between entities.

- **Integrity Constraints**: Ensuring the accuracy and consistency of data in a database.
  - **Primary Key**: A unique identifier for each record in a table.
  - **Foreign Key**: A field in one table that is a primary key in another table.
  - **CHECK**: Ensuring that the values in a column satisfy a specific condition.
  - **ON DELETE CASCADE**: Automatically deleting related rows in child tables when a row in the parent table is deleted.

- **Normalization**: The process of organizing data in a database to minimize redundancy and dependency.
  - **Candidate Key**: A set of attributes that can uniquely identify a tuple in a relation.
  - **Super Key**: A set of attributes that can uniquely identify a tuple in a relation, but may contain extraneous attributes.
  - **Minimal Super Key**: A super key from which no attribute can be removed without losing the unique identification property.

#### 2. Relational Schema and Queries
- **Relational Schema**: Defining the structure of a database using relations and their attributes.
- **Query Analysis**: Analyzing and understanding the output of SQL queries based on given data.

#### 3. Data Manipulation
- **Insertion, Deletion, and Updates**: Understanding how to manipulate data in a database using SQL commands.
  - **INSERT**: Adding new rows to a table.
  - **DELETE**: Removing rows from a table.
  - **UPDATE**: Modifying existing rows in a table.

